// Profile.js
import React, { useState, useEffect, Link } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  TextField,
  Checkbox,
  FormControlLabel,
  Button,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@mui/material';
import { fetchData } from '../utils/fetchData';

const Profile = () => {
  const [user, setUser] = useState({});
  const [goals, setGoals] = useState([]);
  const [updatedUser, setUpdatedUser] = useState({});
  const { userId } = useParams();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await fetchData(`/api/user/profile/${userId}`);
        setUser(response.data);
        setGoals(response.data.goals || []);
        setUpdatedUser({ ...response.data });
      } catch (error) {
        console.error(error);
      }
    };

    fetchUserData();
  }, [userId]);

  const handleGoalChange = (goal) => {
    const updatedGoals = goals.includes(goal)
      ? goals.filter((g) => g !== goal)
      : [...goals, goal];
    setGoals(updatedGoals);
    setUpdatedUser({ ...updatedUser, goals: updatedGoals });
  };

  const handleUpdateProfile = async () => {
    try {
      // Send updated user data to the server
      await fetchData(`/api/user/profile/${userId}`, {
        method: 'PUT',
        body: JSON.stringify(updatedUser),
        headers: {
          'Content-Type': 'application/json',
        },
      });
      // Optionally, show a success message or redirect to another page
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <Box p={4}>
      <Typography variant="h4">User Profile</Typography>
      <Box mt={2} mb={2}>
        <TextField
          fullWidth
          label="Name"
          value={updatedUser.name || ''}
          onChange={(e) => setUpdatedUser({ ...updatedUser, name: e.target.value })}
        />
      </Box>
      <Box mt={2} mb={2}>
        <TextField
          fullWidth
          label="Age"
          type="number"
          value={updatedUser.age || ''}
          onChange={(e) => setUpdatedUser({ ...updatedUser, age: e.target.value })}
        />
      </Box>
      <Box mt={2} mb={2}>
        <FormControl fullWidth>
          <InputLabel>Gender</InputLabel>
          <Select
            value={updatedUser.gender || ''}
            onChange={(e) => setUpdatedUser({ ...updatedUser, gender: e.target.value })}
          >
            <MenuItem value="Male">Male</MenuItem>
            <MenuItem value="Female">Female</MenuItem>
          </Select>
        </FormControl>
      </Box>
      <Box mt={2} mb={2}>
        <TextField
          fullWidth
          label="Height (cm)"
          type="number"
          value={updatedUser.height || ''}
          onChange={(e) => setUpdatedUser({ ...updatedUser, height: e.target.value })}
        />
      </Box>
      <Box mt={2} mb={2}>
        <TextField
          fullWidth
          label="Weight (kg)"
          type="number"
          value={updatedUser.weight || ''}
          onChange={(e) => setUpdatedUser({ ...updatedUser, weight: e.target.value })}
        />
      </Box>
      <Box mt={2} mb={2}>
        <Typography variant="h6">Select Your Goals:</Typography>
        <FormControlLabel
          control={
            <Checkbox
              checked={goals.includes('Weight Loss')}
              onChange={() => handleGoalChange('Weight Loss')}
            />
          }
          label="Weight Loss"
        />
        <FormControlLabel
          control={
            <Checkbox
              checked={goals.includes('Muscle Gain')}
              onChange={() => handleGoalChange('Muscle Gain')}
            />
          }
          label="Muscle Gain"
        />
        {/* Add more goal options */}
      </Box>
      <Box mt={4}>
        <Button variant="contained" color="primary" onClick={handleUpdateProfile}>
          Update Profile
        </Button>
        <Button
          variant="contained"
          color="primary"
          style={{ marginLeft: '16px' }}
          // Add a link to the exercise page with user details
          // Replace '/exercise' with the actual route to display exercises
          component={Link}
          to={`/exercise?userId=${userId}&gender=${updatedUser.gender}&age=${updatedUser.age}&weight=${updatedUser.weight}&height=${updatedUser.height}&goals=${goals.join(',')}`}
        >
          Get Exercises
        </Button>
      </Box>
    </Box>
  );
};

export default Profile;
